import React from 'react';
import './Navbar.css';
import logo from '../assets/logo.png'; // adjust the path if needed

export default function Navbar() {
  return (
    <nav className="navbar">
      <div className="navbar-logo">
        <img src={logo} alt="Wings Cafe Logo" className="logo-img" />
        <span>Wings Cafe</span>
      </div>
      <ul className="navbar-links">
        <li><a href="/" onClick={(e) => e.preventDefault()}>Dashboard</a></li>
        <li><a href="/" onClick={(e) => e.preventDefault()}>Products</a></li>
        <li><a href="/" onClick={(e) => e.preventDefault()}>Add Product</a></li>
        <li><a href="/" onClick={(e) => e.preventDefault()}>Settings</a></li>
      </ul>
    </nav>
  );
}
